    -- 1. Tarihleri Guncelledik (2023 - 2025 Arasi)
    DECLARE dongu_tarihi DATE DEFAULT '2023-01-01';
    DECLARE bitis_tarihi DATE DEFAULT '2025-12-01';
    
    -- Enflasyon ve Mevsimsellik Degiskenleri
    DECLARE enflasyon_carpani DECIMAL(10,2);
    
    -- Temizlik: Once eski verileri silelim (Tertemiz baslayalim)
    TRUNCATE TABLE kds_sonuc; 
    DELETE FROM performans;    

    -- DONGU BASLIYOR (Ocak 2023 -> Aralik 2025)
    WHILE dongu_tarihi <= bitis_tarihi DO
        
        -- 2. ENFLASYON HESABI (Yillari 1 ileri kaydirdik)
        -- 2023 artik "Baz Yil" oldu (Eskiden 2022'ydi)
        IF YEAR(dongu_tarihi) = 2023 THEN SET enflasyon_carpani = 1.0; 
        
        -- 2024 Enflasyonlu Yil
        ELSEIF YEAR(dongu_tarihi) = 2024 THEN SET enflasyon_carpani = 1.8; 
        
        -- 2025 ve sonrasi (Yuksek fiyatlar)
        ELSE SET enflasyon_carpani = 3.5; 
        END IF;

        -- 3. VERILERI OLUSTUR VE EKLE (Buralar ayni kaldi)
            magaza_id, 
            donem_ay, 
            toplam_ciro, 
            en_cok_satan_kategori, 
            kira_gideri, 
            personel_sayisi, 
            personel_devir_hizi, 
            musteri_memnuniyet_puani, 
            stok_devir_hizi
        )
        SELECT 
            m.magaza_id,
            DATE_FORMAT(dongu_tarihi, '%Y-%m-%d'),
            
            -- CIRO HESABI
            (
                m.magaza_m2 * 1000 * enflasyon_carpani * CASE 
                    -- YAZ SEZONU (Haziran-Eylul)
                    WHEN MONTH(dongu_tarihi) IN (6,7,8,9) AND i.demografik_yapi = 'Turistik' THEN 3.0 
                    WHEN MONTH(dongu_tarihi) IN (6,7,8,9) AND i.demografik_yapi = 'Öğrenci' THEN 0.5 
                    -- OKUL SEZONU (Eylul-Ekim)
                    WHEN MONTH(dongu_tarihi) IN (9,10) AND i.demografik_yapi = 'Öğrenci' THEN 1.5 
                    -- KIS SEZONU
                    WHEN MONTH(dongu_tarihi) IN (12,1,2) AND i.demografik_yapi = 'Turistik' THEN 0.3 
                    ELSE 1.0 
                END
                * (0.8 + (RAND() * 0.4)) 
            ),
            
            -- KATEGORI SECIMI (Mevsimsel)
            CASE 
                WHEN MONTH(dongu_tarihi) IN (6,7,8) THEN 'İçecek' 
                ELSE h.oncelikli_kategori 
            END,

            -- KIRA GIDERI
            (m.magaza_m2 * 100 * i.kira_carpan_katsayisi * enflasyon_carpani * 0.5),

            -- PERSONEL SAYISI
            CASE 
                WHEN MONTH(dongu_tarihi) IN (6,7,8) AND i.demografik_yapi = 'Turistik' THEN FLOOR(m.magaza_m2 / 30)
                ELSE FLOOR(m.magaza_m2 / 50)
            END,

            -- PERSONEL DEVIR HIZI
            FLOOR(5 + (RAND() * 10)),

            -- MEMNUNIYET
            FLOOR(6 + (RAND() * 4)),

            -- STOK DEVIR HIZI
            CASE 
                WHEN MONTH(dongu_tarihi) IN (6,7,8) AND i.demografik_yapi = 'Turistik' THEN 60
                ELSE 30
            END

