        LEFT JOIN kategori_hedefleri h ON i.demografik_yapi = h.demografik_yapi
        GROUP BY m.magaza_id; 

        -- Tarihi 1 ay ileri sar
        SET dongu_tarihi = DATE_ADD(dongu_tarihi, INTERVAL 1 MONTH);
        
    END WHILE;
END$$

