DROP TRIGGER IF EXISTS `kds_sonuc_guncelle_duzenleme`;
DELIMITER $$
CREATE TRIGGER `kds_sonuc_guncelle_duzenleme` AFTER UPDATE ON `performans` FOR EACH ROW BEGIN
    DECLARE puan_finansal DECIMAL(5,2);
    DECLARE puan_musteri DECIMAL(5,2);
    DECLARE puan_operasyon DECIMAL(5,2);
    DECLARE puan_ik DECIMAL(5,2);
    DECLARE toplam_kds_puani DECIMAL(5,2);
    DECLARE karar_metni VARCHAR(100);

    DELETE FROM kds_sonuc WHERE magaza_id = OLD.magaza_id AND donem = OLD.donem_ay;

    IF NEW.kira_gideri > 0 THEN
        IF (NEW.kira_gideri / NEW.toplam_ciro) <= 0.05 THEN SET puan_finansal = 100;
        ELSEIF (NEW.kira_gideri / NEW.toplam_ciro) >= 0.20 THEN SET puan_finansal = 0;
        ELSE SET puan_finansal = 100 - (((NEW.kira_gideri / NEW.toplam_ciro) - 0.05) * 666); 
        END IF;
    ELSE SET puan_finansal = 100; END IF;


    SET puan_musteri = NEW.musteri_memnuniyet_puani * 10;

    CASE 
        WHEN NEW.stok_devir_hizi BETWEEN 30 AND 60 THEN SET puan_operasyon = 100;
        WHEN NEW.stok_devir_hizi < 15 THEN SET puan_operasyon = 30;
        WHEN NEW.stok_devir_hizi > 90 THEN SET puan_operasyon = 50;
        ELSE SET puan_operasyon = 70;
    END CASE;


    IF NEW.personel_devir_hizi <= 5 THEN SET puan_ik = 100;
    ELSEIF NEW.personel_devir_hizi >= 50 THEN SET puan_ik = 0;
    ELSE SET puan_ik = 100 - (NEW.personel_devir_hizi * 2);
    END IF;

 
    SET toplam_kds_puani = (puan_finansal * 0.40) + (puan_musteri * 0.30) + (puan_operasyon * 0.20) + (puan_ik * 0.10);

 
    SET karar_metni = CASE 
        WHEN toplam_kds_puani >= 85 THEN 'MÜKEMMEL: Ödüllendir'
        WHEN toplam_kds_puani >= 70 THEN 'İYİ: İzlemeye Devam'
        WHEN toplam_kds_puani >= 50 THEN 'ORTA: Aksiyon Planı İste'
        ELSE 'ACİL: Kapsamlı Denetim'
    END;
    
    VALUES (NEW.magaza_id, NEW.donem_ay, NEW.toplam_ciro, NEW.musteri_memnuniyet_puani, toplam_kds_puani, karar_metni, NOW());

END
$$
